    <circle cx={6} cy={6} r={6} fill="white" stroke="#FCC43E" strokeWidth={3} />
  </svg>
);

const MemoEllipse4Icon2 = memo(Ellipse4Icon2);
export { MemoEllipse4Icon2 as Ellipse4Icon2 };
